}

.footer-item > a {
    color: var(--color-body);
}

/* Collapsible */

.collapsible__content {
    max-height: 0;
    overflow: hidden;
    transition: all .7s ease-in-out;
}

.collapsible--expanded .collapsible__content {
    max-height: 100vh;
    
}

/* Navigation Bar */

/* js need */

