        padding-left: 17rem;
        width: 700px;
    }

    @media screen and (min-width: 1920px) {
        .hero-content {
            padding-left: 25rem;
        }

        .hero-start {
            padding-left: 28rem;
        }

        .icon__hero {
            left: 147rem;
        }
    }
}

/* Input Main */

/* js need */

.group-input {
    position: relative;
}

.input-ng {
    position: absolute;
    left: 2rem;
    top: -17.5rem;
}

.input-nav {
    padding: 1rem;
    background: var(--color-secondary);
    font-size: 1rem;
    font-weight: bold;
    border-radius: 10px;
    color: var(--color-primary);
}

.input-nav:focus {
    background: var(--color-primary);
    color: var(--color-body);
}

.input-g {
    background-color: var(--color-primary);
    display: flex;
    flex-direction: column;
    width: 75%;
    font-size: 1rem;
    position: absolute;
    padding: 2rem 1.5rem 2rem 1.5rem;
    left: 2rem;
    top: -15rem;
    border-radius: 10px;
    color: var(--color-secondary);
    font-weight: bold;
